import '../css/Header.css';
import { Link } from 'react-router-dom';
function Header(){
    return (
         
        <div className='navbar text-decoration-none  bg-warning shadow-lg mb-5'>
            <Link to="/" className='nav-item active  text-decoration-none'>Home</Link>
            <Link to="/about" className='nav-item  text-decoration-none'>About</Link>
            <Link to="/services" className='nav-item  text-decoration-none'>Services</Link>
        </div>
    )
}
export default Header;
